import React from "react";
import { FaFacebook, FaGoogle, FaTwitter, FaShareAlt } from "react-icons/fa";
import Footer from "../components/Footer";

export default function UserProfile() {
  return (
    <div className="min-h-screen bg-gray-100">
      
      {/* Top Background Image + Title */}
      <div
        className="w-full h-64 flex items-center justify-center bg-cover bg-center"
        style={{
          backgroundImage:
            "url('https://images.unsplash.com/photo-1496307042754-b4aa456c4a2d?auto=format&fit=crop&w=1600&q=80')",
        }}
      >
        <h1 className="text-white text-4xl font-bold bg-black/40 px-6 py-2 rounded-lg">
          User Profile
        </h1>
      </div>

      {/* Middle Section */}
      <div
        className="w-full flex flex-col items-center py-10 bg-cover bg-center"
        style={{
          backgroundImage:
            "url('https://images.unsplash.com/photo-1524638431109-93d95c22a26c?auto=format&fit=crop&w=1600&q=80')",
        }}
      >
        {/* Profile Image */}
        <img
          src="https://randomuser.me/api/portraits/men/45.jpg"
          alt="profile"
          className="w-28 h-28 rounded-full border-4 border-white shadow-lg"
        />

        {/* User Info */}
        <h2 className="text-2xl font-bold text-white mt-3">John Doe</h2>
        <p className="text-white/80 text-sm">Since Member: 2020</p>

        {/* Rating */}
        <div className="text-yellow-400 text-2xl mt-1">★★★★★</div>

        {/* Social Icons */}
        <div className="flex gap-6 text-white text-2xl mt-4">
          <FaFacebook className="cursor-pointer hover:text-blue-300" />
          <FaGoogle className="cursor-pointer hover:text-red-300" />
          <FaTwitter className="cursor-pointer hover:text-blue-400" />
          <FaShareAlt className="cursor-pointer hover:text-green-300" />
        </div>
      </div>

      {/* Buttons Section */}
      <div className="max-w-2xl mx-auto bg-white shadow-lg rounded-lg p-6 mt-8">

        <button className="w-full bg-blue-600 text-white py-3 rounded-lg mb-4 hover:bg-blue-700">
          Profile
        </button>

        <button className="w-full bg-green-600 text-white py-3 rounded-lg mb-4 hover:bg-green-700">
          Edit Profile
        </button>

        <button className="w-full bg-purple-600 text-white py-3 rounded-lg mb-4 hover:bg-purple-700">
          My Ads
        </button>

        <button className="w-full bg-orange-600 text-white py-3 rounded-lg mb-4 hover:bg-orange-700">
          Featured Ads
        </button>

        <button className="w-full bg-red-600 text-white py-3 rounded-lg hover:bg-red-700">
          Published Ads
        </button>
      </div>

      {/* Footer */}
      <div className="mt-10">
        <Footer />
      </div>
    </div>
  );
}
